import React from "react";

export class ToggleButtons extends React.Component {
    render() {
        return (
                this.props.products.map(x => x
                    .map(product => product.id === this.props.product ? console.log(product.attributes) : ''
                                // .map(attribute => console.log(attribute))
        )))
    }
}
